function CMSNewsList(){}CMSNewsList.prototype.initDatPicker=function(){var t=$("#start-picker"),e=$("#end-picker"),n=new Date;n.getFullYear(),n.getMonth(),n.getDate();t.datepicker(),e.datepicker()},CMSNewsList.prototype.listenDeleteEvent=function(){$(".delete-btn").click(function(){console.log("-----delete---");var t=$(this).attr("data-news-id");xfzalert.alertConfirm({text:"确定要删除么？",confirmCallback:function(){xfzajax.post({url:"/cms/delete_news/",data:{news_id:t},success:function(t){200==t.code&&(window.location=window.location.href)}})}})})},CMSNewsList.prototype.run=function(){this.initDatPicker(),this.listenDeleteEvent()},$(function(){(new CMSNewsList).run()});